#----------------------------------------------------------------------

def _my_getter(img, mask_colour):
    bmp = img.GetBitmap()
    if mask_colour is not None:
        bmp.SetMaskColour(mask_colour)
    return bmp
    
def _make_my_getter(img, mask_colour='white'):
    return lambda: _my_getter(img, mask_colour)

